Effective date = March 3, 2021

The Fixed Fees Total amount shall be paid as follows:
i. 30% due upon signing of this Agreement;
ii. 30% due upon the earlier of a) the Go-Live Date or b) three (3) months after the Effective Date = June 18, 2021;
iii. 40% due upon earlier of a) first clinical use or b) 90 days following the payment described in (ii) above.

